type QuestionCardProps = {
  question: string;
  answers: string[];
  userAnswer: string;
  totalQuestion: number;
  questionNumber: number;
  callback: any;
};

const QuizCard: React.FC<QuestionCardProps> = ({
  question,
  answers,
  userAnswer,
  totalQuestion,
  questionNumber,
  callback,
} ) => {
  return <h1>Quiz Card</h1>;
};

export default QuizCard;
